                <div className="col-md-4">
                    <div className="card mb-4 " style={{ backgroundColor: '#E8FAFFC7' }}>
                        <img
                            className="btn btn-outline-light" href="https://www.facebook.com/profile.php?id=100064003516242" rel="noopener noreferrer"
                            src="Book.jpg"
                            // className="card-img-top img-thumbnail rounded"
                            alt="Saad Book of Surgery"

                            style={{ maxHeight: "380px", width: "auto" }}
                        />
                        <div className="card-body text-center">
                            <h5 className="card-title">Saad's Book of Surgery</h5>
                            <p>Price: 1800</p>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}
